import logo from './logo.svg';
import './App.css';
import '/node_modules/bootstrap/dist/css/bootstrap.rtl.min.css';
import { Navbar } from './component/Navbar';

function App() {
  return (
    <>
     <div>
     <Router>
     <Navbar />
      <div className="app-container">

        <Switch>

          <Route path="/Navbar" component={Navbar} > <Navbar/> </Route>

        </Switch>

      </div> <br />
      <Footer />
    </Router>   
     </div>
    </>
  );
}

export default App;
